import React from 'react'
import PropTypes from 'prop-types'

const Navbar = (props) => {

    return (
        <div>
            <h1>
                <i className={props.icon} /> {props.title}
            </h1>
        </div>
    )

}

Navbar.defaultProps = {
    title: "E-Voting-App",
    icon: "fa fa-github"
};
Navbar.propTypes = {
    title: PropTypes.string.isRequired,
    icon: PropTypes.string.isRequired 
};

export default Navbar
